import React, {Component} from 'react';
import './pagination.css';

import pagination_arrow from  "../../public/materials/Line 1.svg";
import pagination_center from  "../../public/materials/Ellipse 3.svg";

class Pagination extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return(
      <div className="col-md-2">
          <div className="row space"></div>
          <div className="row justify-content-center"><img className="arrowUP" src={pagination_arrow} alt="arrow" /></div>
          <div className="row justify-content-center"><img src={pagination_center} alt="center" /></div>
          <div className="row justify-content-center"><img className="arrowDOWN" src={pagination_arrow} alt="arrow" /></div>
      </div>
    )
  }
}

export default Pagination;
